waves.point_eqs_str:
branch=rand(2);

//base
wx=if(equal(sc,0),.5,wx);
wy=if(equal(sc,0),.1,wy);

wx=if(equal(sc,1),.5,wx);
wy=if(equal(sc,1),.4,wy);

//calculate previous branch length
d=if(below(sc,2),.3,.7*d);

//angle
wainc=if(equal(branch,1),.2+(tren*.1),-.2-(treb*.1));

wa=if(below(sc,2),3.1415927*.5,wa+wainc);

//branches
wx=if(above(sc,2),wx+cos(wa)*d,wx);
wy=if(above(sc,2),wy+sin(wa)*d,wy);

//sample count
sc=if(equal(sc,11),0,sc+1);

a=if(below(sc,2),0,.1);

r=abs(sin(time*.5));
g=abs(sin(time*.25));
b=treb_att*.65;

x=wx;
y=wy;

